import React, { Component } from "react";

export default function adminDashboard() {
   const logOut = () => {
     window.localStorage.clear();
     window.location.href = "./sign-up";
   };
     return (
       <div>
         Name<h1>"Welcome admin"</h1>
         <button onClick={logOut} className=" btn btn-primary">
           Log out
         </button>
       </div>
     );
  
}
